import React from "react";
import { ItemContainer, ItemText } from "./styles";

function ItemRepo({ repo }) {
  return (
    <>
      <ItemContainer>
        <ItemText>
          <h3>Joice</h3>
          <p>dio/Joice</p>
          <br />
          <a href="#">Repositorio</a>
        </ItemText>
      </ItemContainer>
    </>
  );
}

export default ItemRepo;
